
ALTER DATABASE COLLATE latin1_general_cs;

SET FOREIGN_KEY_CHECKS=0;

-- ----------------------------
--  Table structure for `CONTROLE`
-- ----------------------------
DROP TABLE IF EXISTS `CONTROLE`;
CREATE TABLE `CONTROLE` (
  `ctrl_id` int(11) NOT NULL AUTO_INCREMENT,
  `ctrl_lib` varchar(30) CHARACTER SET latin1 COLLATE latin1_general_cs DEFAULT NULL,
  `ctrl_coef` decimal(4,2) NOT NULL,
  `mod_id` int(11) NOT NULL,
  PRIMARY KEY (`ctrl_id`),
  KEY `fk_module_idx` (`mod_id`),
  CONSTRAINT `fk_module` FOREIGN KEY (`mod_id`) REFERENCES `MODULE` (`mod_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=113 DEFAULT CHARSET=latin1 COLLATE=latin1_general_cs;

-- ----------------------------
--  Table structure for `ETUDIANT`
-- ----------------------------
DROP TABLE IF EXISTS `ETUDIANT`;
CREATE TABLE `ETUDIANT` (
  `etud_id` int(11) NOT NULL AUTO_INCREMENT,
  `etud_nom` varchar(20) CHARACTER SET latin1 COLLATE latin1_general_cs NOT NULL,
  `grp_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`etud_id`)
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=latin1 COLLATE=latin1_general_cs;

-- ----------------------------
--  Table structure for `MODULE`
-- ----------------------------
DROP TABLE IF EXISTS `MODULE`;
CREATE TABLE `MODULE` (
  `mod_id` int(11) NOT NULL AUTO_INCREMENT,
  `mod_lib` varchar(30) CHARACTER SET latin1 COLLATE latin1_general_cs NOT NULL,
  `mod_coef` decimal(4,2) NOT NULL,
  `ue_id` int(11) NOT NULL,
  PRIMARY KEY (`mod_id`),
  KEY `fk_ue_idx` (`ue_id`),
  CONSTRAINT `fk_ue` FOREIGN KEY (`ue_id`) REFERENCES `UE` (`ue_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=latin1 COLLATE=latin1_general_cs;

-- ----------------------------
--  Table structure for `NOTER`
-- ----------------------------
DROP TABLE IF EXISTS `NOTER`;
CREATE TABLE `NOTER` (
  `ctrl_id` int(11) NOT NULL,
  `etud_id` int(11) NOT NULL,
  `note` decimal(4,2) NOT NULL DEFAULT '-1.00',
  PRIMARY KEY (`ctrl_id`,`etud_id`),
  KEY `fk_etudiant_idx` (`etud_id`),
  CONSTRAINT `fk_controle` FOREIGN KEY (`ctrl_id`) REFERENCES `CONTROLE` (`ctrl_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_etudiant` FOREIGN KEY (`etud_id`) REFERENCES `ETUDIANT` (`etud_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_general_cs;

-- ----------------------------
--  Table structure for `UE`
-- ----------------------------
DROP TABLE IF EXISTS `UE`;
CREATE TABLE `UE` (
  `ue_id` int(11) NOT NULL AUTO_INCREMENT,
  `ue_lib` varchar(20) CHARACTER SET latin1 COLLATE latin1_general_cs NOT NULL,
  `ue_coef` decimal(4,2) NOT NULL,
  PRIMARY KEY (`ue_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1 COLLATE=latin1_general_cs;

